  };

  return (
 <div className="min-h-screen bg-gray-50">
      <Header />
      <div className="max-w-7xl mx-auto px-4 py-8">
        <div className="mb-6">
          <div className="flex justify-between items-center mb-6">
            <h2 className="text-3xl font-bold text-gray-900">Payments</h2>
            <button className="px-4 py-2 bg-rose-500 text-white rounded-md hover:bg-rose-600 flex items-center">
              <Plus className="h-4 w-4 mr-2" />
              Add Payment
            </button>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow-sm p-6">
          <div className="text-center py-12">
            <CreditCard className="h-16 w-16 text-gray-400 mx-auto mb-4" />
            <h3 className="text-lg font-medium text-gray-900 mb-2">Payment Records</h3>
            <p className="text-gray-600">Payment management will be implemented here</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PaymentsPage;
